'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendTrueMarketOrderCommand extends SendSingleCommandWithoutResponse {
    marketOrderRequest;
    clientRate;
    pointSize;
    timeController;
    constructor() {
        super();
        this.commandName = "SendTrueMarketOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createTrueMarketOrderRequestMessage(this.tradingSession, this.marketOrderRequest, this.clientRate, this.pointSize, this.requestNumberGenerator, stdlib.nowutc(), this.timeController);
    }
}
module.exports = SendTrueMarketOrderCommand
